import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './pages/HomePage.js';


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/a" element={<HomePage />} />
      </Routes>
    </Router>
  );
}

export default App;
